#include "../base/icode.hpp"
class L1663 : public icode
{
public:
    void run()
    {
        cout << getSmallestString(50220, 1018738) << " "
             << endl;
    }

    string getSmallestString(int n, int k)
    {
        string res(n, 'a');
        k -= n;
        while (k > 0)
        {
            res[--n] += min(25, k);
            k -= min(25, k);
        }
        return res;
    }
};